package Streams;import java.util.ArrayList;import java.util.Arrays;import java.util.List;import java.util.stream.Collectors;public class Divisible5 {    public static void main(String[] args) {        List<Integer> list = new ArrayList<>(Arrays.asList(15, 20, 46, 89, 90, 88, 9));        List<Integer> div = list.stream()                .filter(val -> val % 5 == 0)                .collect(Collectors.toList());        System.out.println("Divisible by 5-"+div);    }}